var mongoose = require("mongoose"),
  express = require("express"),
  router = express.Router();

// Student Model 
var studentSchema = require("../models/Student");

// CREATE Student 
router.post("/create-student", function (req, res, next) {
  studentSchema.create(req.body).then(function (data) {
    console.log(data);
    res.json(data);
  });
});
// READ Students 
router.get("/", function (req, res) {
  studentSchema.find().then(function (data) {
    res.json(data);
  });
});

// UPDATE student 
router.route("/update-student/:id")
// Get Single Student 
.get(function (req, res) {
  studentSchema.findById(req.params.id).then(function (error, data) {
    if (error) {
      return next(error);
    } else {
      res.json(data);
    }
  });
})

// Update Student Data 
.put(function (req, res, next) {
  studentSchema.findByIdAndUpdate(req.params.id, {
    $set: req.body
  }, function (error, data) {
    if (error) {
      return next(error);
      console.log(error);
    } else {
      res.json(data);
      console.log("Student updated successfully !");
    }
  });
});

// Delete Student 
router.delete("/delete-student/:id", function (req, res, next) {
  studentSchema.findByIdAndRemove(req.params.id, function (error, data) {
    if (error) {
      return next(error);
    } else {
      res.status(200).json({
        msg: data
      });
    }
  });
});
module.exports = router;
