        }
    } catch (error) {
        console.log(error);
    }
}

const deleteUser = async (id) => {
    try {
        let user = await db.User.findOne({
            where: {id: id}
        })
        if (user) {
            await user.destroy()
            return {
                EM: 'delete thanhcong',
                EC: 0,
                DT: []
            }
        }
        else {

        }

    } catch (error) {
        console.log(error);
        return {
            EM: 'error',
            EC: -1,
            DT: []
        }
    }
}

module.exports = {
    getAllUsers, createUser, updateuser, deleteUser,
    getUserWithPagi
}
